import React, { Component } from "react";
import PlantItem from "./PlantItem";

export default class Cart extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        {this.props.totalPrice}
        {this.props.cartList
          .map(item => (
            <PlantItem
              item={item}
              onPlus={this.props.onPlus}
              onMinus={this.props.onMinus}
            />
          ))}
      </div>
    );
  }
}
